import React from "react";
import styled from "styled-components";
import {
  HomeWork,
  MiscellaneousServices,
  ContactPage,
} from "@styled-icons/material";
import { WineGlassAlt, Images, FileImport } from "@styled-icons/fa-solid";

export default function AppNavigationMenu() {
  const accordionMenuConfig = [
    {
      id: "homeLink",
      displayName: "Home",
      iconComponent: HomeWork,
      className: "active",
    },
  ];

  const getLinkTag = (item) => {
    return (
      <a href="#">
        {React.createElement(item.iconComponent, {
          size: "20",
          color: "#fff",
        })}
        {item.displayName}
        {item.subMenu && <span className="submenu-indicator">+</span>}
      </a>
    );
  };

  return (
    <React.Fragment>
      <div id="jquery-accordion-menu" className="jquery-accordion-menu">
        <div className="jquery-accordion-menu-header">Header </div>
        <ul>
          {accordionMenuConfig.map((item, index) => {
            return (
              <li className={item.className} key={item.id}>
                {getLinkTag(item)}
              </li>
            );
          })}
          <li>
            <a href="#">
              <WineGlassAlt size="20" />
              Events{" "}
            </a>
          </li>
          <li>
            <a href="#">
              <Images size="20" />
              Gallery{" "}
            </a>
            <span className="jquery-accordion-menu-label">12 </span>
          </li>
          <li>
            <a href="#">
              <MiscellaneousServices size="20" />
              Services{" "}
            </a>
            <ul className="submenu">
              <li>
                <a href="#">Web Design </a>
              </li>
              <li>
                <a href="#">Hosting </a>
              </li>
              <li>
                <a href="#">Design </a>
                <ul className="submenu">
                  <li>
                    <a href="#">Graphics </a>
                  </li>
                  <li>
                    <a href="#">Vectors </a>
                  </li>
                  <li>
                    <a href="#">Photoshop </a>
                  </li>
                  <li>
                    <a href="#">Fonts </a>
                  </li>
                </ul>
              </li>
              <li>
                <a href="#">Consulting </a>
              </li>
            </ul>
          </li>
          <li>
            <a href="#">
              <FileImport size="20" />
              News{" "}
            </a>
          </li>
          <li>
            <a href="#">
              <i className="fa fa-suitcase"></i>Portfolio{" "}
            </a>
            <ul className="submenu">
              <li>
                <a href="#">Web Design </a>
              </li>
              <li>
                <a href="#">Graphics </a>
                <span className="jquery-accordion-menu-label">10 </span>
              </li>
              <li>
                <a href="#">Photoshop </a>
              </li>
              <li>
                <a href="#">Programming </a>
              </li>
            </ul>
          </li>
          <li>
            <a href="#">
              <i className="fa fa-user"></i>About{" "}
            </a>
          </li>
          <li>
            <a href="#">
              <ContactPage size="20" />
              Contact{" "}
            </a>
          </li>
        </ul>
        <div className="jquery-accordion-menu-footer">Footer </div>
      </div>
    </React.Fragment>
  );
}
